text:
@sydneywatson__ makes a good point pointing out the flaws of just viewing men as the universal Рђю bad guyРђЮ.to some, she may support some controversial things but i think it should be said that women arenРђЎt automatically victims and men arenРђЎt automatically perpetrators. both genders experience violence and we need to take a look at how men are also affected in domestic abuse as well. for those who believe that men canРђЎt get abused or raped or sexually assaulted, please reconsider your ways and educate yourself. this is a problem for everyone and everyone needs to realize that abuse and sexual abuse knows no gender or age. it can happen to anyone.  it is important to keep in mind that the problem against women is still there, itРђЎs the fact that some use it to dismiss and put this false portrayal on others is where is crosses a line.

thanks for listening to my ted talk.

